const Patient = (props) => {
    return (
        <>
        <h1>Patient Information</h1>
        <p>Name: {props.name}</p>
        <p>Age: {props.age}</p>
        <p>Department: {props.department}</p>
        <p>Doctor: {props.doctor}</p>
        </>
    );
}
export default Patient;
